import React, { Component } from 'react';
import axios from 'axios';
import Principal from './Principal';
import url from '../Conexions/conexion.js'
import swal from 'sweetalert';

const baseURL = url.url + "/Profile/Email/Update";


class CorreoUpdate extends Component {
    state = {
        profile: [],
        id: '',
        email: '',
        identifier: '',
        status: false
    }

    handleChange = (event) => {

        this.setState({
            identifier: document.getElementById('Identifier').value,
            email: document.getElementById('Email').value,


        })
    };

    GetUser = () => {

        const config = {
            headers: { 'identifier': this.state.identifier, 'Authorization': 'Bearer ' + localStorage.getItem("token") }
        }

        axios.get(baseURL, config)
            .then(response => {
                this.setState({
                    profile: response.data,
                    id: response.data.profile.id,
                    email: response.data.profile.email,
                    status: true

                })
            })
            .catch((error) => {
                console.log(error);
            });
    }

    PutEmail = (event) => {
        // event.preventDefault();
        const config = {
            headers: { 'profileId': this.state.id, 'Authorization': 'Bearer ' + localStorage.getItem("token") }
        }
        console.log(config);


        const data = {
            "email": this.state.email
        }
        console.log(data);

        axios.put(baseURL, data, config)
            .then(res => {
                console.log(res.status);

                if (res.status == 200) {

                    swal({
                        title: "Email",
                        text: "Su Email se actualizo con exito",
                        icon: "success",
                        buttons: "Aceptar"
                    }).then(function () {
                        window.location = "/Correo";
                    })
                } if (res.status == 400) {
                    swal({
                        title: "Email",
                        text: "Verifique los campos",
                        icon: "warning",
                        buttons: "Aceptar"
                    })
                } else {

                }

            }).catch(res => {
                console.log(res.status);

                if (res.status == 500) {
                    swal({
                        title: "Email",
                        text: "Error en el servidor",
                        icon: "error",
                        buttons: "Aceptar"
                    })
                } if (res.status == 400) {
                    swal({
                        title: "Email",
                        text: "Verifique los campos",
                        icon: "warning",
                        buttons: "Aceptar"
                    })
                } else {

                }

            })

    }

    render() {
        return (
            <div className='sb-nav-fixed'>
                <div className='row g-0'>
                    <div id="layoutSidenav_content">
                        <Principal />
                        <div className='margen-top h-100'>
                            <div className='d-flex justify-content-center align-items-center h-100'>
                                <div className=''>
                                    <div className='cardperfil' style={{ borderRadius: '10rem' }}>
                                        <div className=''>
                                            <div className='align-items-center'>
                                                <div className=' p-4 text-black'>
                                                    <section className="centrarelementos">
                                                        <h2 className="text-center mb-4">Actualizar Correo</h2>
                                                    </section>

                                                    <form className='centrarelementos'>
                                                        <div className="form-group row mb-4">
                                                            <label htmlFor="text" className="col-sm-12 centrarelementos col-form-label">Correo</label>
                                                        </div>

                                                        <div className="form-group row mb-4">
                                                            <input type="text" className="form-control" pattern="000([0-9]{6})" name="Identifier" id='Identifier' onChange={this.handleChange} required />
                                                            <div className="mb-4"></div>
                                                            <div className="col-sm-12 ">
                                                                <button type="button" className="btn btn-outline-danger form-label boton-color" onClick={this.GetUser}>Buscar</button>
                                                            </div>
                                                        </div>

                                                        <div className="form-group row mb-4">
                                                            <input type="text" className="form-control" defaultValue={this.state.email} pattern="000([0-9]{6})" name="Email" id='Email' onChange={this.handleChange} required />
                                                            <div className="mb-4"></div>
                                                            <div className="col-sm-12">
                                                                <button type="button" className="btn btn-outline-danger form-label boton-color" onClick={this.PutEmail}>Actualizar</button>
                                                            </div>
                                                        </div>

                                                    </form>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>

                    </div>

                </div>
            </div>
        );
    }
}

export default CorreoUpdate;
